    //console.log("hola")
    ApiService.getTastings()
  }

  return (<div>

<button onClick={() => getAllTastings()}>get tastings from db</button>


    <div className="wine__card__container">

    {wineList.map((wine,index) => {
      return (<div><WineCard wine={wine} /></div>)})}

    </div>

  </div>)

}
